def fast_farey_ratio(f, pertol=0.01):

    frac = f
    if frac > 1:
        frac = 1/f

    ln, ld = 0, 1
    rn, rd = 1, 1
    l = 1

    if (abs(frac - ln/ld) <= frac*pertol):
        n, d = ln, ld
        e = abs(frac - ln/ld)
    elif (abs(frac - rn/rd) <= frac*pertol):
        n, d = rn, rd
        e = abs(frac - rn/rd)
    else:
        cn, cd = ln+rn, ld+rd
        l  = l + 1
        while (abs(frac - cn/cd) > frac*pertol):
            if frac > cn/cd:
                ln, ld = cn, cd
            else:
                rn, rd = cn, cd
            cn, cd = ln+rn, ld+rd
            l  = l + 1
        n, d = cn, cd
        e = abs(frac - cn/cd)

    if f > 1:
        n, d = d, n

    return n, d, l, e

