def summarize_shap_table(df, cols, quantile=None):
    result = {}
    for col in cols:
        if np.issubdtype(df[col].dtype, np.number):
            if quantile is None:
                result[col] = df[col].abs().mean()
            else:
                result[col] = df[col].abs().quantile(quantile)
        else:
            result[col] = df[col].value_counts().index[0]  
