def lifetime(mass1: float):

    tau: float = 0

    if mass1 <= 1.3:
        tau = mass1**(-.6545) * 10.
    elif 1.3 < mass1 <= 3.:
        tau = mass1**(-3.7) * 10**1.351
    elif 3. < mass1 <= 7.:
        tau = mass1**(-2.51) * 10**.77
    elif 7. < mass1 <= 15.:
        tau = mass1**(-1.78) * 10**.17
    elif 15. < mass1 <= 53.054:
        # discontinuity to previous step
        tau = mass1**(-.86) * 10**(-.94)
    else:
        # mass > 53
        tau = 1.2*mass1**(-1.85)+.003

    return tau

