    if value < 0:
        raise ValueError("Value cannot be negative")
    elif value > 299 and is_warning == True:
        return False
    elif value > 299 and is_warning == False:
        return True
    elif value <= 299 and is_warning == False:
        return True
    elif value <= 299 and is_warning == True:
        return False
