def extendedEuclidean( a, b ):


    s, old_s = 0, 1
    t, old_t = 1, 0
    r, old_r = int(b), int(a)

    while r:
        quotient = old_r // r #integer division
        old_r, r = r, (old_r - quotient*r)
        old_s, s = s, (old_s - quotient*s)
        old_t, t = t, (old_t - quotient*t)

    return (old_r, old_s, old_t)

