    points = 0
    dart = x * x + y * y
    radius_center = 1
    radius_middle = 5
    raidus_outer = 10
    if dart - radius_center * radius_center <= 0:
        points = 10 # center
    elif dart - radius_middle * radius_middle <= 0:
        points = 5 #middle circle
    elif dart - raidus_outer * raidus_outer <= 0:
