def get_insight(df):

    df_info = {}
    df_info['period'] = {
    "from" : min(df['year']),
    "to" : max(df['year'])
    }
    df_info['nbr_watched'] = df.shape[0]
    df_info['first'] = df.iloc[-1, df.columns.tolist().index("titleUrl")]
    df_info['last'] = df.iloc[0, df.columns.tolist().index("titleUrl")]
    return df_info

