import torch

def CE_MAE_loss(x, y):

    return torch.nn.functional.binary_cross_entropy(x, y) + torch.nn.functional.l1_loss(
        x, y
    )

def convert_to_seconds(val, t):

    result = -1
    if t == 'y':
        result = val*365*24*3600
    elif t == 'd':
        result = val*24*3600
    elif t == 'h':
        result = val*3600
    elif t == 'm':
        result = val*60
    elif t == 's':
        result = val

    return result

